  \"This data set consists of 0.5-meter pixel resolution, four band orthoimages covering
  the Humboldt Bay area. An orthoimage is remotely sensed image data in which displacement
  of features in the image caused by terrain relief and sensor orientation have been
  mathematically removed. Orthoimagery combines the image characteristics of a photograph
  with the geometric qualities of a map. Each orthoimage provides imagery over a DOQQQ
  with a 100-meter image overlap between adjacent files. The projected coordinate
  system is UTM Zone 10 North with a NAD83 datum.\",\n\t\"license_title\": null,\n\t\"extras\":
